import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { 
  FiUsers, 
  FiAward, 
  FiBriefcase, 
  FiHeart, 
  FiArrowRight, 
  FiGlobe, 
  FiTrendingUp,
  FiCode,
  FiLayers
} from 'react-icons/fi';

const About = () => {
  const [hoveredCard, setHoveredCard] = useState(null);
  const [activeTab, setActiveTab] = useState('mission');

  // Team members data
  const teamMembers = [
    {
      id: 1,
      name: 'Sarah Johnson',
      role: 'CEO & Founder',
      image: 'https://images.unsplash.com/photo-1494790108377-be9c29b29330?ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=80',
      bio: '10+ years of experience in tech industry. Passionate about innovation.'
    },
    {
      id: 2,
      name: 'Michael Chen',
      role: 'Lead Developer',
      image: 'https://images.unsplash.com/photo-1507003211169-0a1dd7228f2d?ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=80',
      bio: 'Full-stack developer with expertise in React and Node.js.'
    },
    {
      id: 3,
      name: 'Emma Rodriguez',
      role: 'Creative Director',
      image: 'https://images.unsplash.com/photo-1438761681033-6461ffad8d80?ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=80',
      bio: 'Design expert with a keen eye for user experience and aesthetics.'
    },
    {
      id: 4,
      name: 'David Kim',
      role: 'Marketing Head',
      image: 'https://images.unsplash.com/photo-1500648767791-00dcc994a43e?ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=80',
      bio: 'Digital marketing strategist with proven track record of growth.'
    }
  ];

  // Stats data
  const stats = [
    { icon: <FiUsers size={24} />, number: '250+', label: 'Happy Clients' },
    { icon: <FiBriefcase size={24} />, number: '500+', label: 'Projects Completed' },
    { icon: <FiAward size={24} />, number: '25+', label: 'Awards Won' },
    { icon: <FiHeart size={24} />, number: '99%', label: 'Client Satisfaction' }
  ];

  // Values data
  const values = [
    {
      icon: <FiGlobe size={32} />,
      title: 'Global Mindset',
      description: 'We think and act globally, embracing diverse perspectives.'
    },
    {
      icon: <FiTrendingUp size={32} />,
      title: 'Continuous Growth',
      description: 'We believe in constant learning and improvement.'
    },
    {
      icon: <FiCode size={32} />,
      title: 'Technical Excellence',
      description: 'We strive for the highest quality in everything we build.'
    },
    {
      icon: <FiLayers size={32} />,
      title: 'Collaboration',
      description: 'We achieve more by working together effectively.'
    }
  ];

  // Animation variants
  const fadeIn = {
    hidden: { opacity: 0, y: 20 },
    visible: { opacity: 1, y: 0, transition: { duration: 0.5 } }
  };

  const staggerChildren = {
    visible: { transition: { staggerChildren: 0.1 } }
  };

  return (
    <div className="about-page">
      {/* Hero Section */}
      <section className="hero-section">
        <div className="container">
          <motion.div 
            className="hero-content"
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.7 }}
          >
            <h1>We Create Digital Experiences That Matter</h1>
            <p>We are a team of passionate designers, developers, and strategists dedicated to building innovative solutions that drive growth and transformation.</p>
            <motion.button 
              whileHover={{ scale: 1.05, boxShadow: "0 10px 20px rgba(0,0,0,0.1)" }}
              whileTap={{ scale: 0.95 }}
              className="cta-button"
            >
              Explore Our Work <FiArrowRight />
            </motion.button>
          </motion.div>
        </div>
      </section>

      {/* Stats Section */}
      <section className="stats-section">
        <div className="container">
          <motion.div 
            className="stats-grid"
            variants={staggerChildren}
            initial="hidden"
            whileInView="visible"
            viewport={{ once: true }}
          >
            {stats.map((stat, index) => (
              <motion.div 
                key={index} 
                className="stat-card"
                variants={fadeIn}
                whileHover={{ y: -5, transition: { duration: 0.2 } }}
              >
                <div className="stat-icon">{stat.icon}</div>
